import React from "react";
import Home from "./components/Home";

function App() {
  return (
    <div className="text-center p-10">
      <h1 className="text-4xl font-bold mb-4 text-blue-600">Welcome to PassionPoint</h1>
      <Home />
    </div>
  );
}

export default App;
